import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Login from './Login'; // Import your Login component
import ScheduleView from './ScheduleView'; // Import your ScheduleView component
import CourseView from './CourseView'; // Import the CourseView component

function App() {
  return (
    <Routes>
      <Route path="/" element={<Login />} />  {/* Login Page */}
      <Route path="/schedule" element={<ScheduleView />} />  {/* Schedule Page */}
      <Route path="/course" element={<CourseView />} />  {/* Course Details Page */}
    </Routes>
  );
}

export default App;
